import "./Acordian.css"
const data = [
    { id: 1, title: "A" },
    { id: 2, title: "B" },
    { id: 3, title: "C" },
    { id: 4, title: "D" },
]
function AcordianBody() {

    return (
        < div>
            <div className="mainBox">
                {data.map((item) => {
                    return <div key={item.id} className="IntBox">
                        <div>{item.title}</div>
                        <div>{">"}</div>
                    </div>
                })}

            </div>
            <button >Selected Item</button>
        </div>
    )
}
export default AcordianBody
